const ButtonComponent = ({ btnType, btnProps, label }) => {

  function clickFunction() {
    document.getElementById('investmentOverlay').classList.remove('absolute');
    document.querySelector('.roi-investment-returns div').style.marginTop = '0px';
  }

  return (
    <button type={btnType} className={`${btnProps}`} onClick={clickFunction}>
        {label}
    </button>
  );
};
export default ButtonComponent;
